import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { KBarProvider, KBarContent, KBarSearch, KBarResults } from "kbar";
import "bootstrap/dist/css/bootstrap.css";

const actions = [
  {
    id: "projects",
    name: "Projects",
    shortcut: ["p"],
    keywords: "project",
    perform: () => (window.location.pathname = "projects"),
  },
  {
    id: "about",
    name: "About",
    shortcut: ["a"],
    keywords: "about",
    perform: () => (window.location.pathname = "about"),
  },
];

ReactDOM.render(
  <KBarProvider actions={actions}>
    <KBarContent>
      <KBarSearch />
      <KBarResults />
    </KBarContent>
    <App />
  </KBarProvider>,
  document.getElementById("root")
);
